import React from 'react'
import Paper from '@material-ui/core/Paper'
import Button from '@material-ui/core/Button';
 const  CreatePage = () => {
  return (
    <div>
        <Paper>
          <h1>Bot Publishing</h1>
          <Button></Button>
          <p style={{color:'gray'}}>YOUR FACEBOOK PAGES</p>
        </Paper>
    </div>
  )
}

export default CreatePage;
